            padding-right: 6px;
            width: 100%;
        }

        .mfp-counter {
            position: absolute;
            top: 0;
            right: 0;
            color: #cccccc;
            font-size: 12px;
            line-height: 18px;
        }

        .mfp-arrow {
            position: absolute;
            top: 0;
            opacity: 0.65;
            margin: 0;
            top: 50%;
            margin-top: -55px;
            padding: 0;
            width: 90px;
            height: 110px;
            -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
        }

        .mfp-arrow:active {
            margin-top: -54px;
        }

        .mfp-arrow:hover,
        .mfp-arrow:focus {
            opacity: 1;
        }

        .mfp-arrow:before,
        .mfp-arrow:after,
        .mfp-arrow .mfp-b,
        .mfp-arrow .mfp-a {
            content: "";
            display: block;
            width: 0;
            height: 0;
            position: absolute;
            left: 0;
            top: 0;
            margin-top: 35px;
            margin-left: 35px;
            border: solid transparent;
        }

        .mfp-arrow:after,
        .mfp-arrow .mfp-a {
