        :root {
            --bs-blue: #0d6efd;
            --bs-indigo: #6610f2;
            --bs-purple: #5848BB;
            --bs-pink: #d63384;
            --bs-red: #dc3545;
            --bs-orange: #fd7e14;
            --bs-yellow: #ffc107;
            --bs-green: #198754;
            --bs-teal: #20c997;
            --bs-cyan: #0dcaf0;
            --bs-white: #fff;
            --bs-gray: #6c757d;
            --bs-gray-dark: #343a40;
            --bs-gray-100: #f8f9fa;
            --bs-gray-200: #e9ecef;
            --bs-gray-300: #dee2e6;
            --bs-gray-400: #ced4da;
            --bs-gray-500: #adb5bd;
            --bs-gray-600: #6c757d;
            --bs-gray-700: #495057;
            --bs-gray-800: #343a40;
            --bs-gray-900: #212529;
            --bs-primary: #008AFF;
            --bs-secondary: #f73164;
            --bs-success: #51BB25;
            --bs-info: #A927F9;
            --bs-warning: #F8D62B;
            --bs-danger: #DC3545;
            --bs-light: #fafbfe;
            --bs-dark: #0E0B2B;
            --bs-primary-rgb: 0, 138, 255;
            --bs-secondary-rgb: 247, 49, 100;
            --bs-success-rgb: 81, 187, 37;
            --bs-info-rgb: 169, 39, 249;
            --bs-warning-rgb: 248, 214, 43;
            --bs-danger-rgb: 220, 53, 69;
            --bs-light-rgb: 250, 251, 254;
            --bs-dark-rgb: 14, 11, 43;
            --bs-white-rgb: 255, 255, 255;
            --bs-black-rgb: 0, 0, 0;
            --bs-body-color-rgb: 98, 117, 157;
            --bs-body-bg-rgb: 255, 255, 255;
            --bs-font-sans-serif: system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji";
            --bs-font-monospace: SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace;
            --bs-gradient: linear-gradient(180deg, rgba(255, 255, 255, 0.15), rgba(255, 255, 255, 0));
            --bs-body-font-family: Nunito Sans, sans-serif;
            --bs-body-font-size: 1rem;
            --bs-body-font-weight: 400;
            --bs-body-line-height: 1.7;
            --bs-body-color: #62759d;
            --bs-body-bg: #fff;
        }

        *,
        *::before,
        *::after {
            -webkit-box-sizing: border-box;
            box-sizing: border-box;
        }

        @media (prefers-reduced-motion: no-preference) {
            :root {
                scroll-behavior: smooth;
            }
        }

        body {
            margin: 0;
            font-family: var(--bs-body-font-family);
            font-size: var(--bs-body-font-size);
            font-weight: var(--bs-body-font-weight);
            line-height: var(--bs-body-line-height);
            color: var(--bs-body-color);
            text-align: var(--bs-body-text-align);
            background-color: var(--bs-body-bg);
            -webkit-text-size-adjust: 100%;
            -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
        }

        hr {
            margin: 1rem 0;
            color: inherit;
            background-color: currentColor;
            border: 0;
            opacity: 0.25;
        }

        hr:not([size]) {
            height: 1px;
        }

        h1, .h1, h2, .h2, h3, .h3, h4, .h4, h5, .h5, h6, .h6 {
            margin-top: 0;
            margin-bottom: 0.5rem;
            font-weight: 700;
            line-height: 1.6;
            color: #152c5b;
        }

        h1, .h1 {
            font-size: calc(1.35rem + 1.2vw);
        }

        @media (min-width: 1200px) {
            h1, .h1 {
                font-size: 2.25rem;
            }
        }

        h2, .h2 {
            font-size: calc(1.3125rem + 0.75vw);
        }

        @media (min-width: 1200px) {
            h2, .h2 {
                font-size: 1.875rem;
            }
        }

        h3, .h3 {
            font-size: calc(1.275rem + 0.3vw);
        }

        @media (min-width: 1200px) {
            h3, .h3 {
                font-size: 1.5rem;
            }
        }

        h4, .h4 {
            font-size: 1.125rem;
        }

        h5, .h5 {
